import {useLoginUserQuery, useRegisterUserMutation, userApi} from "./apis";


export function useLogin(){
	const a = useLoginUserQuery(null, {
		selectFromResult: result => {
			if (result.data){
				result = result.data;
			}
		}
	});


	console.log(a);
}
